import Button from "@material-ui/core/Button";
import Layout from "../components/Layout";

function finale() {

    const goback = () => {
        localStorage.removeItem('email');
        Router.push('/');
    }

    return ( <
        Layout >
        <
        div >
        <
        div style = {
            {
                textAlign: "center",
                fontSize: "22px",
                fontFamily: "'Russo One', sans-serif",
