        <
        span className = "flicker" > Congratulations < /span> <
        br / >
        <
        br / >
        <
        span className = "flicker" > You have completed all Questions < /span> <
        br / >
        <
        br / >
        <
        span className = "flicker" > More exciting ones on the way! < /span> <
        br / >
        <
        br / >
        <
        br / >
        <
        /div> <
        div style = {
            {} } >
        <
        Button className = "btnSubmit"
        variant = "contained"
        color = "primary"

        elevation = { 3 }
        onClick = { goback }
        style = {
            { backgroundColor: '#000044', border: "0px solid white", height: "40px", width: "100px", borderRadius: "7px", display: 'block', margin: '0 auto', } } >
        Logout / Go back <
        /Button> <
        /div> <
        /div> <
        div style = {
            { paddingTop: '220px' } } >

        <
        /div>

        <
        /Layout>
    );
}

export default finale;
